This HOC wraps a configure component with a component that manages the `model` in its state. This saves the custom element from having to call `ReactDOM.render()` on a change.

```javascript
import {withStatefulModel} from '@pie-lib/config-ui';

const StatefulComp = withStatefulModel(ConfigureCompoent):
```

